window.bookSummaryJSON = "<p><b>Katie Maddison never </b><b><i>wanted</i></b><b> to learn how to kick a demon's ass, all she was doing was helping a fellow university student with his Chem homework.</b></p> <p><i>She just trusted people too much.</i></p> <p>Now, she will be the new weapon in a war she had no idea existed with warriors wielding both weapons and supernatural abilities.</p> <p><b>Demon Hunters, Demon Fighters ... Known as </b><b><i>The Damned</i></b><b>.</b></p> <p>People possessed by Demons, but still remaining in control of their bodies.</p> <p><b>One of the most powerful Demon's in Hell can't defeat his sister, so he sets her up to be sacrificed and killed.</b></p> <p><i>The only problem? The human she possesses retained her sanity and together they might be a catalyst to change the future of the war.</i></p> <p>If they can stay alive and learn how to share one body, that is.</p> <p><i>Now, a millennium old Demon who has no morals is stuck with a hard-headed young woman, who has her own ideas regarding what her future will be.</i></p> <p>Together, they work out a truce, of sorts.</p> <p><i>Until the Demon gets hooked on soap operas, game shows and changing Katie's body without permission.</i></p> <p><b>Then All Hell Breaks Loose.</b></p> <p>Scroll back to the top, and click “Read for Free” or “Buy Now” and kick back for a fun supernatural action packed adventure that will have you yelling for the good guys, and laughing at the arguments between Katie and … <i>her.</i></p>"; 
